pub enum Progress {

    /// The stream didn't contain any data
    Nothing,

    /// The stream ended in the middle of parsing
    Partial,
}

pub enum Error {

    /// There was not enough input to parse a value.
    TooShort(Progress),

    /// Excessive input was provided.
    Leftovers,

    /// Parse error occured (data was in invalid format).
    ParseError,

    /// IO Error occured.
    IoError(io::Error),
}
